INSERT INTO `content` VALUES (3, 1, '<p>\r\n权益一：全年52节会员课免费学\r\n\r\n</p><p>&nbsp;亲爱的朋友呀，当我静听着海涛时，我好几次&nbsp; 亲爱的朋友呀，当我静听着海涛时&nbsp;</p><p><img src=\"https://api.adong.fun/file/1583579175739_87.png\" style=\"max-width:100%;\"><br></p><p>权益二：免费问题</p><p>&nbsp;亲爱的朋友呀，当我静听着海涛时，我好几次&nbsp;\r\n亲爱的朋友呀，当我静听着海涛时&nbsp;<br></p><p><img src=\"https://api.adong.fun/file/1583579175739_87.png\" style=\"max-width:100%;\"><br></p><div>筛选标签\r\n</div><div><br></div><div>1，价格\r\n</div><div>2，重量\r\n</div><div>3，清洁面积（续航时间）\r\n</div><div>5，清洁效果\r\n</div><div>6，维护成本\r\n</div><div>7，使用疲劳度\r\n</div><div>8，音量\r\n</div><div>9，缺点\r\n</div><div>10，评级\r\n</div><div>11，优点\r\n</div><p><!--?xml version=\"1.0\" encoding=\"UTF-8\"?-->\r\n\r\n</p><div>还有之前已经添加的&nbsp;</div><p><img src=\"https://api.adong.fun/file/1583738118055_757.png\" style=\"max-width:100%;\"><br></p>');
