INSERT INTO `free_article` VALUES (39, '吸尘器效果怎么比', '2020-03-09 00:23:15', '', '吸尘器效果怎么比', 0, 'https://api.adong.fun/chargeArticle/getArticle?articleId=39', '', 2, '<div><div style=\"text-align: left;\">此文章图片建议横屏观看</div><div style=\"text-align: left;\">“全天星图”之类的“天空图”描绘了宇宙全景，但又是哪一种天空呢？因为不同频率的光学望远镜观测到的天空不尽相同。于是天文学家开启了“巡天调查”：分别基于可见光、伽马射线、X 射线、红外线和射电波对宇宙进行全景观测。由此绘制出的5幅全新天空图将为我们展现宇宙的不同面貌。</div></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><br></div>');
INSERT INTO `free_article` VALUES (40, '吸尘器效果怎么比', '2020-03-09 15:06:01', '', '吸尘器效果怎么比', 1, 'https://api.adong.fun/chargeArticle/getArticle?articleId=40', 'https://api.adong.fun/file/1583737988377_279.png', 2, '<p><img src=\"https://api.adong.fun/file/1583737716099_34.png\" style=\"max-width:100%;\"><br></p><p><img src=\"https://api.adong.fun/file/1583737729804_990.png\" style=\"max-width:100%;\"><br></p><p><br></p><p><br></p><p><img src=\"https://api.adong.fun/file/1583742924767_309.png\" style=\"max-width:100%;\"><br></p><p><br></p><p>小编整理自XVC合伙人胡博予在沃顿中心的演讲内容：</p><p>大家好，首先感谢主办方给我这个机会来给大家分享，也谢谢大家来到沃顿中心来听我瞎扯。首先我还是来做一个自我介绍吧。我叫胡博予，是XVC的合伙人，在创办XVC之前，我大部分时间在创业。我从99年开始参与创办了一家公司，目前是中国最大的信贷风险管理软件公司，叫做安硕信息（300380），已在创业板上市了。几年前我加入了VC行业，陆续投了10来家公司，待会我会和大家聊几个具体案例。</p>');
