INSERT INTO `product_Report` VALUES (22, 12, 'Tineco Pure One 清洁效果会比dyson v11更好吗', '<p style=\"text-align: left;\"><b>这个问题的本质是什么？</b></p><p style=\"text-align: left;\">Tineco Pure One 清洁效果会比dyson v11更好吗？<br></p><p style=\"text-align: left;\">有可能</p><p style=\"text-align: left;\">Tineco Pure One 吸力 150AW，dyson v11 185AW，的确存在差距，但是双方标得都是理论最大值的，在低功率的普通档能够长时间保持的吸力才是硬核桃，而且最终清洁效果不是靠吸力一个单一因素，结构设计，风道，吸头设计都会影响，所以这个数字听听就好饿了，还是以自己实际测试结果为准，Tineco Pure One 清洁效果会比dyson v11更好，并非不可能。</p><figure style=\"text-align: left;\"><img src=\"https://pic3.zhimg.com/80/v2-7da396b9d148431bbda7502064028956_hd.jpg\" normal\"=\"\" width=\"735\"></figure><p style=\"text-align: left;\"><b>这个问题的前提条件是什么？</b></p><p style=\"text-align: left;\">-续航时间的延长是否以牺牲清洁效果为代价？</p><p style=\"text-align: left;\">Tineco Pure One 吸力 100分钟，dyson v11 60分钟，乍看之下，觉得Tineco续航时间碾压dyson，不过这只是表象，100分钟的续航时间应该包含了备用电池，单块电池估计只有50分钟，10分钟的续航时间在实际体验过程中差异不大，Dyson和Tineco的除了增加电池容量，都利用了“自动调节吸力”的功能。不过的工作原理略有不同。V11 Absolute可以测量刷条的电阻，以检测从硬地板到地毯的表面变化，并在切换时增加功率。Pure One 使用灰尘传感器来确定表面有多脏，并提高较脏地板的吸力。那么问题来了，如果续航提升依靠自动调节吸力来实现的，它的前提应该是清洁效果令人满意，否则的话这样续航增加根本没有意义。</p><figure style=\"text-align: left;\"><img src=\"https://pic1.zhimg.com/80/v2-0b6abdf71c8b61e0baed2d62b1e5db14_hd.jpg\" normal\"=\"\" width=\"615\"></figure><p><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\">-工作降噪是否以牺牲清洁效果为代价</div></p><figure style=\"text-align: left;\"><img src=\"https://pic2.zhimg.com/80/v2-74ef88cd39b7a52f5c3ee8b4b80d80c9_hd.jpg\" normal\"=\"\" width=\"424\"></figure><p style=\"text-align: left;\">吸尘器降噪一般通过使用隔音材料，提升密封性，加隔音层，甚至通过控制工作噪音的波长降低音量，但是这一切都不如降低吸尘器的功率来得有效。</p><p style=\"text-align: left;\">一般来说，希望吸力更强，就需要用更高的功率，让电机的转速更快，从而产生更强的吸力，噪音就是高转速带来的副产物。所以能够在更低的功率条件下，完成清洁任务，也意味着工作噪音更低，tineco声称自己能够实现71分贝的工作音量，这已经达到戴森部分主流款型的水平了。能达到这样的水准，我相信与戴tineco自动调整吸力有很大的关系，等于通过将吸尘器尽可能置于低功率条件下，工作音量自然来得更低，但是这一切的前提必须不以牺牲清洁效果为代价的。</p><p style=\"text-align: left;\">-智能滤芯清洁能延缓吸力会衰减吗</p><p style=\"text-align: left;\">戴森有多锥旋风的专利，这项专利最大的价值就在于极大降低吸力衰减，所以其他吸尘器品牌只能绕道其他技术路线，Tineco Pure One为了减缓衰减，对清洁方式有了创新，之前吸尘器的滤网，大都会建议水洗，水洗的弊端在于洗多了，滤棉很容易受损，作用也就大大折扣了。Tineco Pure One另辟蹊径，直接用吸尘器将滤棉中的粉尘吸出，理论上这么操作，滤网的使用寿命延长了，反之则是衰减延缓了。听上去不错，但是实际是否真得如此美好，还得用了才知道。</p><p><div style=\"text-align: left;\"><br></div><b><div style=\"text-align: left;\"><b>综上，如果产品体验的提升没有以牺牲清洁效果为代价，吸力衰减的问题得倒极大改善，Tineco Pure One有机会把比dyson v11比下去。</b></div></b></p><p style=\"text-align: left;\"><br></p><ul><li style=\"text-align: left;\"><b>这些新的炫酷配置不重要，不建议作为决策依据</b></li></ul><figure style=\"text-align: left;\"><img src=\"https://pic3.zhimg.com/80/v2-48d76ed9058d812110e3b4ca8ae5abda_hd.jpg\" normal\"=\"\" width=\"721\"></figure><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><b>清洁程度显示</b></p><p style=\"text-align: left;\">具体清洁程度，肉眼可见即可判断，非要告诉你还有pm2.5级的粉尘没有被清理干净，这就是制造焦虑。</p><p style=\"text-align: left;\"><b>吸力显示</b></p><p style=\"text-align: left;\">既然已经将吸力调整直接让吸尘器自己处理，那为什么还要消费者知道吸力的大小，消费者只要知道是否能够清洁干净即可，如果不干净吸尘器自动就会加大吸力，如果还需要人工干涉，那就说吸尘器自动调节吸力就是鸡肋。</p>', '', '2020-02-20 15:41:53', 1, 1);
