INSERT INTO `product_Report` VALUES (32, 11, '测试1', '<p><img src=\"https://api.adong.fun/shanwen/file/1582180647865_459.gif\" style=\"max-width:100%;\"></p><div><div><div><div>管理后台输入框提示</div></div></div></div><div><div><div><p>管理后台输入框提示</p><div><p>产品添加录入<br></p><p><br></p><p>产品品牌提示内容：先输入中文品牌名称，再输入英语名牌名称，例如，戴森dyson</p><p>产品型号提示内容：输入产品具体型号，例如v8 fluffy</p><p>产品分类提示内容：选择产品对应分离，例如戴森dyson v8 fluffy，选择对应分类吸尘器</p><p>产品概述提示内容：输入产品报告中对应概述内容</p><p>产品评级提示内容：输入产品报告中对应的评级</p><p>产品评分提示内容：输入产品对应的总评分（百分制）</p><p>产品颜色提示内容：输入数字1-5，1为推荐，每+1次，评级降一级</p><p>产品星级提示内容：5星制，1为一颗星，0.5为半颗星，例如3.5显示为3星半</p><p>1级指标评分提示内容：输入产品报告中对应的分数（10分制）</p><p><img src=\"https://api.adong.fun/shanwen/file/1582049448798_754.png\" style=\"max-width:100%;\"></p></div></div></div></div>', '测试1', '2020-03-07 01:46:27', 1, 1);
